function App() {
  return (
    <div>
      <BrowserRouter>
        <Routes>
          <Route path='/' element={<Login />}></Route>
          <Route path='/register' element={<Register />}></Route>
          <Route path='/main' element={<Main />}></Route>
          <Route path="/game" element={<Game />}></Route>
          <Route path="/placement" element={<Placement />}></Route>
        </Routes>
      </BrowserRouter>
    </div>
  )
}

export default App;
